// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";

contract UserRightNFT  is ERC1155, Ownable {
    struct Purchase {
        uint256 tokenId;
        uint256 amount;
    }
    struct Holder {
        address buyAddress;
        uint256 amount;
    }
    string private _name;
    string private _symbol;
    mapping(uint256 => string) private _tokenURIs;

    mapping(uint256 =>  Holder[]) private _holderList;
    mapping(address =>  Purchase[]) private _purchaseList;

    constructor() public ERC1155("http://140.238.5.158:3000/api/v1/use-right/{tokenId}") {
        _name = "use right nft";
        _symbol = "URN";
    }
    function symbol() public view virtual returns (string memory) {
        return _symbol;
    }
    function name() public view virtual returns (string memory) {
        return _name;
    }
    function tokenURI(uint256 tokenId) public view virtual returns (string memory) {
        string memory _tokenURI = _tokenURIs[tokenId];
        return _tokenURI;
    }
    function _setTokenURI(uint256 tokenId, string memory _tokenURI) internal virtual {
        _tokenURIs[tokenId] = _tokenURI;
    }
    function _exists(uint256 tokenId) internal view virtual returns (bool) {
        return bytes(_tokenURIs[tokenId]).length > 0;
    }

    /**
     * @dev mtnftid  tokenId, amount  
     */
    function mintNFT(address ownerShipAddress, uint256 tokenId, uint256 amount, string memory tokenURI, string memory data) public onlyOwner{
        if(!_exists(tokenId)){
            _setTokenURI(tokenId, tokenURI);
        }
        _mint(ownerShipAddress, tokenId, amount, bytes(data));
    }
    function getPurchaseList(address ownerAddress)public view returns (Purchase[] memory){
        return _purchaseList[ownerAddress];
    }
    function getHolderList(uint256 tokenId) public view returns (Holder[] memory){
        return _holderList[tokenId];
    }

    event catchErr(string _name, string _err);

    function _afterTokenTransfer(
        address operator,
        address from,
        address to,
        uint256[] memory ids,
        uint256[] memory amounts,
        bytes memory data
    ) internal virtual override {
        for (uint256 i = 0; i < ids.length; ++i) {
            uint256 id = ids[i];
            uint256 fromBalance = 0;
            if(from != address(0))balanceOf(from, id);
            uint256 toBalance = balanceOf(to, id);

            bool pushFlag = false;
            for(uint256 j; j < _holderList[id].length; j++){
                if(_holderList[id][j].buyAddress == from && fromBalance > 0){
                    _holderList[id][j].amount = fromBalance;
                }else if(_holderList[id][j].buyAddress == from && fromBalance == 0 ){
                    delete _holderList[id][j];
                }else if(_holderList[id][j].buyAddress == to){
                    _holderList[id][j].amount = toBalance;
                    pushFlag = true;
                }
            }

            if(!pushFlag){
                _holderList[id].push(Holder(to,toBalance));
                pushFlag=false;
            }

            for(uint256 j; j < _purchaseList[to].length; j++){
                if(_purchaseList[to][j].tokenId == id  && fromBalance > 0){
                    _purchaseList[to][j].amount = fromBalance;
                }else if(_purchaseList[to][j].tokenId == id && fromBalance == 0 ){
                    delete _purchaseList[to][j];
                }else if(_purchaseList[to][j].tokenId == id){
                    _holderList[id][j].amount = toBalance;
                    pushFlag = true;
                }
            }
            if(!pushFlag){
                _purchaseList[to].push(Purchase(id,toBalance));
            }
        }

        super._afterTokenTransfer(operator, from, to, ids, amounts, data);
    }

}
